	/************************************************************************************/
	//Pickups de vida
	var healthPickups = [];
	var collect = function(){
		for (healthNumber in healthPickups){
			if(personagem.intersect(healthPickups[healthNumber])){
				personagem.life++;
				var tempHealth = new Sprite(24,22);  
				tempHealth.image = img_heart;
				health.push(tempHealth);
				scene2.insertBefore(health[health.length-1],chaves);				
				scene2.removeChild(healthPickups[healthNumber]);
				healthPickups.splice(healthNumber,1);
			}
		}
		
		if(this.age % 10 <= 5)
			this.frame = 1;
		else
			this.frame = 0;
	};
	
	for(var i=0; i<5; i++){
		var tempHealth = new Sprite(16,16);  
		tempHealth.image = img_heartPickup;
		tempHealth.addEventListener('enterframe', collect);
		healthPickups.push(tempHealth);		
		scene2.insertBefore(tempHealth,personagem);		
	}
	
	healthPickups[0].x = 365;
	healthPickups[0].y = 140;
	healthPickups[1].x = 380;
	healthPickups[1].y = 580;
	healthPickups[2].x = 550;
	healthPickups[2].y = 40;
