	enemies[2] = createEnemy(800,340,6,false,lab,personagem);
	enemies[3] = createEnemy(1430,20,2,false,lab,personagem);
	enemies[4] = createEnemy(1480,200,6,true,lab,personagem);
	enemies[5] = createEnemy(1440,360,8,false,lab,personagem);
	for(var i=0; i<enemies.length; i++)
		scene2.insertBefore(enemies[i],mask);
		
	/********************************************************************************************/
	// Background music
	if(game.soundOn){
		scene2.bgm = fase2_sound;
		scene2.bgm.play();
		scene2.bgm.volume = 0.1;    // Chico	
		animal_sound.play();
		animal_sound.volume = 0.05; // Chico				
	}
		
	/********************************************************************************************/
